import React from "react";

import { Container, Header, HeaderContent } from "./styles";

import logo from "../../assets/logo.svg";

const Dashboard: React.FC = () => {
  return (
    <Container>
      <Header>
        <HeaderContent>
          <img src={logo} alt="Gobarber logo" />
        </HeaderContent>
      </Header>
    </Container>
  );
};

export default Dashboard;
